import ReviewList from './ReviewList';
import { useNavigate, useLocation} from "react-router-dom";
import {useEffect, useState} from "react";
import axios from "axios";

function KakaoPlace(){
    const navigate = useNavigate();
    const location = useLocation();
    const data = { ...location.state};


    /* kakaoAPI */
    const placeResult = () => {
        const apiKey = process.env.REACT_APP_KAKAO_KEY
        /*
            x = longitude
            y = latitude
            category_group_code = PK6(carpark), FD6(restaurant), CE7(cafe)
        */
        axios.get('https://dapi.kakao.com/v2/local/search/category.json?category_group_code=PM9&radius=1000&size=5', {
            headers : {"Authorization" : "KakaoAK "+ apiKey}
        }).then( (res) => {
             console.log("res.data ::" + JSON.stringify(res.data));
        })
    }


    return(
        <div>
             <button onClick={() => {placeResult('FD6')}}>Restaurant</button>
             <button onClick={() => {placeResult('CE7')}}>Cafe</button>
             <button onClick={() => {placeResult('PK6')}}>Carpark</button>
        </div>
    )
}
export default KakaoPlace;
